      \"doesn't mention a harmful application\"\n  },\n  {\n    \"input\": \"Paper
      Title: The Discrete Gaussian for Differential Privacy; Impact statement: We
      have provided a thorough analysis of the privacy and utility properties of the
      discrete Gaussian and the practicality of sampling it. The impact of this work
      is that it makes the real-world deployment of differential privacy more practical
      and secure. In particular, we bridge the gap between the theory (which considers
      continuous distributions) and the practice (where precision is finite and numerical
      errors can cause a dramatic privacy failures). We hope that the discrete Gaussian
      will be used in practice and, further, that our work is critical to enabling
      these real-world deployments. The positive impact of this work is clear: Differential
      privacy provides a principled and quantitative way to balance rigorous privacy
      guarantees and statistical utility in data analysis. If this technology is adopted,
      it can provide untrusted third parties controlled access to data (e.g., to enable
      scientific research), while affording the data subjects (i.e., the general public)
      an adequate level of privacy protection. In any case, our methods are better
      than using flawed methods (i.e., na\\u00efve floating-point implementations
      of continuous distributions) that inject noise without actually protecting privacy
      or using methods (such as rounding or discrete Laplace) that offer a worse privacy-utility
      tradeoff. The negative impact of this work is less clear. All technologies can
      be misused. For example, an organization may be able to deceptively claim that
      their system protects privacy on the basis that it is differentially private,
      when, in reality, it is not private at all, because their privacy parameter
      is enormous (e.g., \\u03b5 = 10 6 ). One needs to be careful and critical about
      promises made by such companies, and educate the general audience about what
      differential privacy does provide, what it does not, and when guarantees end
      up being meaningless. However, we must acknowledge that there is a small \\u2013
      but vocal \\u2013 group of people who do not want differential privacy to be
      deployed in practice. In particular, the US Census Bureau\\u2019s planned adoption
      of differential privacy for the 2020 US Census has met staunch opposition from
      some social scientists. We cannot speak for the opponents of differential privacy;
      many of their objections do not make sense to us and thus it would be inappropriate
      for us to try summarizing them. However, there is a salient point that needs
      to be discussed: Differential privacy provides a principled and quantitative
      way to balance rigorous privacy guarantees and statistical utility in data analysis.
      This is good, in theory, but, in practice, privacy versus utility is a heated
      and muddy debate. On one hand, data users (such as social scientists) want unfettered
      access to the raw data. On the other hand, privacy advocates want the data locked
